const App: React.FC = () => {
  return (
      <Router>
      <div className="App">
        <header className="App-header">
          <h1>Fiction 2 Form</h1>
        </header>
        <main>
            <Register />
            <div className="animated-boxes">
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </div>
        </main>
          <Switch>
              <Route></Route>
          </Switch>
          <p>Already have an account? <a href={"./Login.tsx"}>Login! </a></p>
      </div>
      </Router>
  );
}

export default App;
